import React from 'react';
import Header from '../components/Header';
import Footer from '../components/Footer';
import ProductCard from '../components/ProductCard'; // Создадим этот компонент
import '../styles/Products.css';
import '../styles/product-card.css';

// Пример данных коллекций (замените на реальные)
const collections = [
  {
    id: 1,
    name: "TREND",
    items: [
      { id: 101, name: 'Кроссовки Storm', price: 8990, image: '/assets/trend1.jpg' },
      { id: 102, name: 'Футболка Urban', price: 2490, image: '/assets/trend2.jpg' }
    ]
  },
  {
    id: 2,
    name: "PANTONE",
    items: [
      { id: 201, name: 'Кроссовки Neon', price: 9500, image: '/assets/pantone1.jpg' },
      { id: 202, name: 'Шорты Color', price: 3200, image: '/assets/pantone2.jpg' }
    ]
  }
];

const Products = () => {
  return (
    <div className="products-page">
    <Header/>
      <h1 className="page-title">КОЛЛЕКЦИИ</h1>
      
      {collections.map(collection => (
        <section key={collection.id} className="collection-section">
          <h2 className="collection-title">{collection.name}</h2>
          <div className="products-grid">
            {collection.items.map(product => (
              <ProductCard key={product.id} product={product} />
            ))}
          </div>
        </section>
      ))}
    </div>
  );
};

export default Products;
